Здравствуйте. Предлагаю остатки детской обуви. Осталось не много, но по очень ВКУСНЫМ ЦЕНАМ!!! 

ОБУВЬ ФИРМЕННАЯ, СЕРТИФИКАТЫ ИМЕЮТСЯ.

Правила: 

- заказ скидываем в личку, на стене ничего не пишем, все вопросы по моделям пишем в комментариях к фото;

- под каждой моделью указаны оставшиеся р-ры;

- оплачиваем налом при получении;

- изменения и дополнения пишем новым личным сообщением или звоним;

Приобрести обувь можно у меня дома рядом со ст.м.Новочеркасская - 4 мин.пешком от метро.

Если Вам не понравился цвет, не подошел размер или полнота после того, как Вы приобрели обувь - ПРИСТРАИВАЕМ СВОИМИ СИЛАМИ ЭТОТ ТОВАР!

        МОЙ ТЕЛ.8(961)806-10-56 АНАСТАСИЯ
